import React from "react";
import PropTypes from "prop-types";
import BlogItemText from "./BlogItemText"; // Adjust the import path as needed

import "./index.css";

export default function BlogLists({ blogPosts }) {
  if (!blogPosts) return null;
  return (
    <div className="blog-list">
      {blogPosts.map((post, index) => {
        return (
          <div
            key={index}
            className="blog-card"
            style={{ borderRadius: "8px", border: "1px solid #ccc" }}
            onClick={() => console.log("TODO: nav to blog", post.title)}
          >
            {post.image && (
              <img src={post.image} className="blog-card-img" alt="..." />
            )}
            <BlogItemText blogPost={post} headerFontSize="20px" />
          </div>
        );
      })}
    </div>
  );
}

BlogLists.propTypes = {
  blogPosts: PropTypes.array.isRequired,
};
